  false,\n\t\"url\": null,\n\t\"notes\": \"Marine bird sighting and other data were
  collected from the NOAA Ship SURVEYOR from 16 August 1980 to 05 September 1980.
  Data were collected by the University of California (UC) as part of the Outer Continental
  Shelf Environmental Assessment Program (OCSEAP). Data were processed by NODC to
  the NODC standard F033 Marine Bird Sighting, Ship/Aircraft Census format. Full format
  description is available from NODC at www.nodc.noaa.gov/. An analog file for this
  accession is available from NODC user services.nnThe F033 format contains data from
  field observations of marine birds made along ship or aircraft survey tracks. These
  data are collected to provide information on population density and distribution.
  Start and end position, date and elapsed time, speed and course, platform type and
  observing techniques are reported for each survey. Environmental information may
  include meteorological and sea surface conditions, distances to the shoreline and
  shelf break, ice characteristics within and outside each transect and surface debris,
  including oil slicks. Species data may include age, sex, color, plumage, number
  of individuals, direction of flight, behavior and food source association. Any number
  of species may be reported within one observation time span.\",\n\t\"owner_org\":
